import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import './button_sign_up.css';

class ButtonSignUp extends React.Component{

  render(){
    return(
      <div className="mx-auto col-6 d-block">
       <Button className="button1" variant="primary" size="lg">
        הזמנה דרך האתר
       </Button>
       <Button className="button2" variant="primary" size="lg">
        Club Card
       </Button>
       <img className="img-hever"src={"../../images/hever.jpg"} alt="heverClub" />
        Club Card
      </div>
    )
  }
}

export default ButtonSignUp;
